INSERT INTO `groups` (`id`, `name`, `description`, `context`, `prerequisite`, `email`, `image`, `restrict_access`, `chat_link`, `drive_link`, `status`, `state`, `visibility`, `creator_id`, `creation_date`) VALUES
	(1, 'Finances', 'Ce groupe s\'occupe de gérer les finances de l\'association. Il gère les dons, les dépenses, les demandes d\'argent, et gère le compte bancaire.', 'Ce groupe a été créé après un problème avec les finances. Le problème était que trop peu de personnes s\'en occupaient.', 'Connaissances minimales en comptabilité requises. Le reste peu être appris sur le tas si vous voulez vous intégrer dans ce groupe. De la rigueur administrative est aussi de mise.', 'finances@assoc.ch', 'group_5ecjoxx4zzza8cni2zv4t523buef6n.jpg', 0, 'chat.link/join?v=1stsrt84k6y6lap', 'drive.link/open?f=q0lsioq6jncp26qne3vc1gnexmpnxe82jxep8szd8m2av59ln6ovi0eghi', 'Travail une fois par mois pour les tâches répétitives', 2, 3, 97, '2020-10-22 22:23:38'),
	(2, 'Réflexion interne', 'Groupe pour réfléchir au fonctionnement interne.', 'Différentes tensions entre certains membres.', 'A partir du moment que vous avez constaté ou pu expérimenter des problèmes internes dans l\'organisation et la structure, vous êtes aptes à travailler dans ce groupe.', 'interne@assoc.ch', 'group_oivabk34kanwygt3vywoeplzf0lqox.jpg', 0, 'chat.link/join?v=qdpxpnmcog8j', 'drive.link/open?f=9ctoomsqi0h9cmp6cfv6buti9izmkvtfova9v5vpv4gaeikv87j4u8w1guutdmo', '', 0, 3, 58, '2019-07-14 23:33:27'),
	(3, 'Coordination', 'Coordination générale. Fait des AG toutes les 2 semaines.', 'Besoin d\'un groupe contenant tout les membres.', 'et refugiendi et omnino rerum gerendarum initia proficiscuntur aut a voluptate aut a dolore. Animadverti, ínquam, te isto modo paulo ante ponere, et scio ab Antiocho nostro dici sic solere; Quae adhuc, Cato, a te dicta sunt, eadem, inquam, dicere posses, si sequerere Pyrrhonem aut Aristonem. \n\nTum ego: Non mehercule, inquam, soleo temere contra Stoicos, non quo illis admodum assentiar, sed pudore impedior; Quae cum dixisset paulumque institisset, Quid est? Ita est quoddam commune officium sap', 'coordination@assoc.ch', 'group_ufgdaawfard697vev4q7biit5onz1v.jpg', 1, 'chat.link/join?v=o21toaugkt', 'drive.link/open?f=h1jw0g3rl3rsabha8drrmodqtkc5f82awx04b35mb4by2pfwp9', '', 1, 3, 67, '2020-11-18 08:05:35'),
	(4, 'Journal', 'Collaboration avec un journal régional mensuel pour un prochain numéro consacré à l\'association. Le journal sera publié fin mai.', 'Envie de prendre place dans l\'espace médiatique et de se faire connaître...', 'Aimer écrire ou dessiner. Les textes sont travaillés très longtemps avant d\'arriver dans leur phase finale.', NULL, NULL, 0, 'chat.link/join?v=ffp0pm17xq4', 'drive.link/open?f=hgy382k7y0npi03y8mgah5emn46xt2r0fwlhs591gc9t3zva8fco1x2itm9n7o', 'En pause pour cause du covid et reporté en septembre.', 2, 3, 61, '2020-07-22 09:35:59'),
	(5, 'Festival', 'Organise les "festivals" annuels de l\'association.', '', 'Quid est? Ita est quoddam commune officium sapientis et insipientis, ex quo efficitur versari in iis, quae media dicamus. Naturalem enim appetitionem, quam vocant o)rmh)n, itemque officium, ipsam etiam virtutem tuentem volunt esse earum rerum, quae secundum naturam sunt. Utrum igitur percurri omnem Epicuri disciplinam placet an de una voluptate quaeri, de qua omne certamen est? Tubulo putas dicere? \n\nSed non sunt in eo genere tantae commoditates corporis tamque productae temporibus tamque mult', NULL, 'group_2mzics1tk66xw6d3q6hsqmplj4pqud.jpg', 0, 'chat.link/join?v=zaao4x3ca1gr', 'drive.link/open?f=a1x3i5c1uprvq4zcixe6zuxuvj623vessj3vmqchr6x3up6bqgiu1ahueably23efwt', '', 1, 4, 5, '2020-04-26 06:35:21'),
	(6, 'Multimédia', 'Crée tous les design et médias dont l\'association a besoin. Affiches, vidéos, photos, montages, ...', 'Rassemblement des personnes créatives de l\'association.', 'In qua si nihil est praeter rationem, sit in una virtute finis bonorum; Non potes, nisi retexueris illa. Ex quo illud efficitur, qui bene cenent omnis libenter cenare, qui libenter, non continuo bene. Sed quoniam et advesperascit et mihi ad villam revertendum est, nunc quidem hactenus; Illorum vero ista ipsa quam exilia de virtutis vi! Quam tantam volunt esse, ut beatum per se efficere possit. Et harum quidem rerum facilis est et expedita distinctio. Quod vestri quidem vel optime disputant,', NULL, 'group_2fg2k8ip25uujr77t4tfyegn4puusp.jpg', 0, 'chat.link/join?v=od2qd00phgqysr5', 'drive.link/open?f=hgdmj64c8xdlj348vrw4yfgo9uqrhvwxu4vjcdk8wgh7k5kwfzmo1igfblmophii4s0', 'Peu actif...', 3, 3, 62, '2019-06-01 16:23:37'),
	(7, 'Sites web', 'Ce groupe s\'occupe des sites web et de leur maintenance.', 'Besoin de connaissances un peu technique et des personnes qui se portent responsables.', NULL, NULL, NULL, 1, 'chat.link/join?v=xdqe7ckinhobwq7', 'drive.link/open?f=yl14uqlohnnkvfhe28jyz0lk39cdb1hd2xg2jjjgwmcdeh3mgvm1aidu6s9enz', 'Travail actif sur le site cantonal...', 3, 3, 8, '2019-08-04 21:43:40'),
	(8, 'Communication', 'Gére toute la communication interne et externe de l\'association. Gère les différents réseaux sociaux.', '', 'ne improbos quidem, si essent boni viri. Commoda autem et incommoda in eo genere sunt, quae praeposita et reiecta diximus; Sed quid attinet de rebus tam apertis plura requirere? Etenim nec iustitia nec amicitia esse omnino poterunt, nisi ipsae per se expetuntur. Quod non faceret, si in voluptate summum bonum poneret. In omni enim arte vel studio vel quavis scientia vel in ipsa virtute optimum quidque rarissimum est. Respondent extrema primis, media utrisque, omnia omnibus. Positum est a nostri', NULL, NULL, 0, 'chat.link/join?v=4ly2xv0f6w8vgkm', 'drive.link/open?f=w6zc6mgrhhd2mmjkfjj8h4amclbpbrzo622z8wrco8fx017seifyd283238tg04', 'Textes et messages envoyés tous les jours. Très actif pour la réfléxion.', 3, 3, 8, '2020-04-06 12:59:46'),
