INSERT INTO `log` (`id`, `title`, `description`, `date`, `creation_date`, `modification_date`, `visible`, `user_id`, `project_id`) VALUES
	(1, 'Démarrage du projet', 'Première réunion du GT Festival pour s\'organiser et planifier le travail pour cette édition 2020. Un brainstorm des idées pour le programme a été fait et noté. L\'entier du GT Festival sera actif. Beaucoup d\'idées et de motivations qui font plaisir à tout le monde. A partir de la fin du Festival 2019, le GT était en pause jusque là, en attente du festival de l\'année suivante... Le travail peut maintenant recommencer intensément.', '2020-05-15 00:00:00', '2020-05-16 12:19:53', NULL, 0, 20, 9),
	(2, 'Choix du thème du projet', 'Après de multiples discussions et votes, le thème du festival a été choisi: "Couleurs et diversité". Un logo en lien avec le thème sera créé.', '2020-05-18 00:00:00', '2020-05-20 13:19:55', '2020-05-22 00:20:14', 1, 49, 9),
	(3, 'Tri éléments programme', 'Toutes les idées notées lors du premier brainstorm ont été passé en revue. Josette s\'est beaucoup renseigné auprès des artistes et potentielles intervenant.e.s. Un premier tri a été fait et validé en réunion du GT Festival (1h).', '2020-05-25 00:00:00', '2020-05-25 22:29:38', '2020-05-26 18:02:07', 0, 19, 9),
	(4, 'Démarrage crowdfunding', 'Rapidement le besoin en budget est devenu gros. Contrairement à l\'année passée ou le GT avait fait une demande à la commune, cette année est venu l\'idée de lancer un crowdfunding avec l\'aide du GT Finances, du GT Communication et du GT Multimédia, puisque cela demande énormément de travail et les délais sont court. Un projet incluant ces 4 groupes a donc été créé. Après le tri des éléments du programme, le montant estimé pour payer les artistes et les intervenant.e.s est de 18\'000 CHF.', '2020-05-27 00:00:00', '2020-05-29 11:36:24', NULL, 0, 35, 9),
	(5, 'Répartition du travail', 'La réunion du 05.06.2020 afin de préparer l\'organisation de ce gros projet, a donné lieu a un simple découpage du projet: \n- Le GT Communication et Multimédia s\'occuperont de communiquer sur le festival et de demander au public de soutenir le festival via le crowdfunding. Pour cela une vidéo est prévue avec des images de l\'année passée, un bout du programme, une interview d\'une artiste de l\'année passée. Le GT Multimédia créera le logo "Couleurs et diversité" et créera également des visuels pour les réseaux sociaux. Le GT Communication se chargera de créer une stratégie de communication et s\'occupera de répondre aux demandes des médias.\n- Le GT Finances s\'occupera des comptes et de la mise en place technique du crowdfunding via une plateforme spécialisée. Il tiendra régulièrement au courant sur le montant reçu. \n- Quant au GT Festival, il sera là pour donner les ressources nécessaires aux 2 autres GT, étant déjà très occupé à organiser le festival lui-même.\n\nLes compétences de chaque groupe ont été favorisées, afin de ne pas perdre du temps à se former. Le GT Finances a déjà eu une expérience de crowdfunding.', '2020-06-05 00:00:00', '2020-06-07 12:39:26', NULL, 1, 26, 2),
	(6, 'Lancement du crowdfunding prévu', 'Le crowdfunding est bientôt prêt à être lancé. Le lancement est prévu pour le 15.06.2020. Le GT Finances est entièrement prêt pour le lancement, tandis que le GT Multimédia finalise la vidéo et commence les visuels. Les visuels devraient être rapidement créé (plus rapidement que la vidéo). Le GT Communication a déjà préparé des messages pour le lancement.', '2020-06-10 00:00:00', '2020-06-12 13:41:33', '2020-06-16 07:10:58', 1, 92, 2),
	(7, 'Logo "Couleurs et diversité" validé', 'Durant la réunion du 08.06.2020 (30min) le logo créé par le GT Multimédia a été validé. Le logo représente le thème du festival et sera intégré aux visuels, à la vidéo et au programme.', '2020-06-08 00:00:00', '2020-06-08 01:40:15', NULL, 1, 28, 2),
	(8, 'Taille du groupe d\'organisation', 'Après un premier rassemblement de 3 personnes pour organiser cette anniversaire et une première réunion, il a été décidé que 3 personnes suffisaient pour toute l\'organisation.', '2020-10-16 00:00:00', '2020-10-18 15:40:57', NULL, 1, 15, 16),
	(9, 'Publication Programme v1', 'Le programme v1 a été publié et est consultable dans le dossier du drive "programme/exports". Il n\'est pas encore en version définitive, mais sera finalisé dans les prochains jours.', '2020-11-25 00:00:00', '2020-11-27 20:01:48', '2020-11-28 23:38:09', 1, 96, 16),
	(10, 'Choix du lieu et réservation', 'Après de nombreux débats et recherches du lieu, un lieu a été décidé: Salle du Chateau, Rue du Châle 12 à Chamblasonoi. La salle est réservée pour le 15 et 16 décembre 2020.', '2020-10-30 00:00:00', '2020-11-01 18:08:48', NULL, 1, 16, 16),
	(11, 'Choix du moment de l\'annonce', 'L\'annonce de la fête à tout le collectif sera faite 3 jours avant, c\'est à dire le 12 décembre 2020. Le collectif a été cependant averti qu\'il se passerait quelque chose de spécial ce jour là et que la date doit être réservée dans la mesure du possible.', '2020-11-03 00:00:00', '2020-11-04 22:53:49', NULL, 1, 42, 16),
	(12, 'Création du projet', 'Le GT Festival a besoin de 18\'000 CHF afin d\'organiser son festival. 3 groupes vont donc travailler ensemble pour organiser un crowdfunding.', '2020-05-27 00:00:00', '2020-05-29 18:04:58', '2020-05-30 18:55:19', 1, 50, 2);
