	(2, 'vincent38', 'VRT', 'Vincent', 'Rigot', 'chat.link/user?t=8d9hztkt6932b8', 'vincent.rigot@assoc.ch', '3359424628', 'Je suis passionné de litérrature, et la presse me questionne beaucoup aujourd\'hui. Les sujets polémiques ne sont pas les plus intéressants, mais ceux dont on ne parle jamais regorgent d\'informations passionnantes et de récits fabuleux.', '$2y$10$RSbqOLWgc..xR8tPrGjyHe30Koe9W7vA6KzJIQU3LQWovIR7PGQ2S', '2019-02-12 09:08:30', 0, 'Actuellement en travail intense sur la rédaction d\'un document contenant des réflexions autour du militantisme à l\'époque des Romains!', 3, 1, '2019-08-01 11:38:10'),
	(3, 'megane87', 'MBN', 'Mégane', 'Blan', 'chat.link/user?t=8nuf18akdss557r', 'megane.blan@assoc.ch', '9851638931', 'Je suis une passionée de festival. J\'en vais 4 fois par mois. Je trouvais le festival de Assoc vraiment génial alors j\'ai voulu venir ajouter mon grain de sel et aider pour la communication. Je suis fan de musique et je joue du violon. Je consacre 5h par semaine à Assoc la plupart de l\'année, et tout mon temps quand il y a le festival...', '$2y$10$LiNmWyIDgkHs7UYmtwV0bO.4p90rZr5OcJ8ITLIOrPovnZGeFiW/e', '2020-05-27 07:50:26', 0, 'Encore quelques jours de repos avant de commencer à travailler à fond pour le festival. J\'aimerai que cette édition soit exceptionnelle!', 1, 1, '2020-09-02 04:33:10'),
